43e\u0440\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D1%82%D0%B5%D0%B2%D0%B8%D0%B4%D0%B5%D0%BE\" title=\"\u041c\u043e\u043d\u0442\u0435\u0432\u0438\u0434\u0435\u043e\">\u041c\u043e\u043d\u0442\u0435\u0432\u0438\u0434\u0435\u043e<\/a> \u0438 \u0432\u0437\u044f\u043b \u043a\u0443\u0440\u0441 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u044e<\/a>; \u0431\u043e\u043b\u044c\u0448\u0435 \u0441\u0443\u0434\u043d\u043e \u043d\u0438\u043a\u0442\u043e \u043d\u0435 \u0432\u0438\u0434\u0435\u043b, \u043e\u043d\u043e \u0438\u0441\u0447\u0435\u0437\u043b\u043e \u0432\u043c\u0435\u0441\u0442\u0435 \u0441 59 \u0447\u043b\u0435\u043d\u0430\u043c\u0438 \u044d\u043a\u0438\u043f\u0430\u0436\u0430 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939_%D0%B3%D0%BE%D0%B4\" title=\"1939 \u0433\u043e\u0434\">1939<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D1%85_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA\" title=\"\u0421\u043e\u044e\u0437 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\">\u0421\u0421\u0421\u0420<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BA%D0%BB%D1%8E%D1%87%D0%B5%D0%BD%D0%B8%D0%B5_%D0%A1%D0%A1%D0%A1%D0%A0_%D0%B8%D0%B7_%D0%9B%D0%B8%D0%B3%D0%B8_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u0418\u0441\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435 \u0421\u0421\u0421\u0420 \u0438\u0437 \u041b\u0438\u0433\u0438 \u041d\u0430\u0446\u0438\u0439\">\u0438\u0441\u043a\u043b\u044e\u0447\u0451\u043d<\/a> \u0438\u0437 \u0441\u043e\u0441\u0442\u0430\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B3%D0%B0_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u041b\u0438\u0433\u0430 \u041d\u0430\u0446\u0438\u0439\">\u041b\u0438\u0433\u0438 \u041d\u0430\u0446\u0438\u0439<\/a> \u0438\u0437-\u0437\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE-%D1%84%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1939%E2%80%941940)\" title=\"\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e-\u0444\u0438\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1939\u20141940)\">\u0437\u0438\u043c\u043d\u0435\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a>&#160;\u2014 \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D1%88%D0%BA%D0%B5%D0%BD%D1%82\" title=\"\u0422\u0430\u0448\u043a\u0435\u043d\u0442\">\u0422\u0430\u0448\u043a\u0435\u043d\u0442\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%90%D0%9D%D0%A2-20%D0%B1%D0%B8%D1%81\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0410\u041d\u0422-20\u0431\u0438\u0441\">\u043f\u043e\u0442\u0435\u0440\u043f\u0435\u043b \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0443<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%9D%D0%A2-20\" title=\"\u0410\u041d\u0422-20\">\u0410\u041d\u0422-20\u0431\u0438\u0441<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 36 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1943_%D0%B3%D0%BE%D0%B4\" title=\"1943 \u0433\u043e\u0434\">1943<\/a>&#160;\u2014 \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D0%B8%D1%82%D0%B1%D